INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(1, 'Гинтама: Финал', 'Выход запланирован на 8 января 2021 года.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(2, 'Рандеву с пулей: Кошмар или королева', 'Вторая часть \"Рандеву с Пулей\", которая снята по одноименном ранобэ.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(3, 'Благословение небожителей', 'Восемь веков назад Лянь Се был наследным принцем прославленного королевства, его любили простые жители и уважали равные по положению. Так что неудивительно, что он, будучи ещё совсем юным, взошёл на Небеса и занял место среди бессмертных небожителей. Однако надолго Лянь Се там не задержался, он глазом не успел моргнуть, как его изгнали обратно в мир смертных. И вот спустя восемьсот лет Лянь Се, ставший уже предметом для насмешек, предпринимает очередную (уже третью по счёту) попытку вернуться на Небеса. Вновь став богом, Лянь Се получает первое задание, выполняя которое, сталкивается с таинственным демоном, имеющим к нему совсем не праздный интерес. Что нужно этому демону от Лянь Се? И удастся ли тому не опростоволоситься и остаться наконец на Небесах?', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(4, 'За гранью моего мира', 'Данная история берёт своё начало в токийском районе Икэбукуро и поведает нам о Мио и Арате — двух друзьях детства. Однако Мио воспринимает своего друга немного иначе, и давно испытывает к Арате чувства. Однажды между ними вспыхивает ссора, но Мио решает помириться с другом, совсем не зная, что ждёт её впереди. Из-за дождя героиня попадает в аварию и, к своему удивлению, приходит в себя в совершенно другом и незнакомом для неё мире.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(5, 'Судьба/Девочка-волшебница Иллия. Фильм', 'В фильме ожидается продолжение сюжета, который начал разворачиваться в 3 сезоне.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(6, 'Последний призыватель', 'Никогда не знаешь, в каком месте, из-за какого угла, вдруг «выскочит» судьба и бесповоротно изменит твою жизнь. У талантливого юного повара знаменательная встреча произошла на кухне, когда, выполняя роль судьбы, перед ним появилась вдруг голодная девушка Дора. Оказалось, что Дора — призванный дух и очень милая богиня, и отныне наш главный героя является её хозяином. Вот только главному герою все эти «богини», «призывы» и «хозяева», мягко говоря, совершенно не интересны, и он из кожи вон лезет, чтобы отделаться от назойливого духа. Однако раз назвался призывателем, пускай и по несчастливой случайности, полезай в кузов, ведь обратной дороги с этого тернистого пути нет. Не оглядываясь и не сворачивая, нужно идти только вперёд по дороге судьбы.', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(7, 'Жозе, тигр и рыба', 'Однажды в незамысловатой жизни студента по имени Цунэо появляется девушка, большую часть своих дней потратившая на чтение и рисование. Занятия похвальные, однако даже им есть своё объяснение. Дело в том, что мечтательная Жозе — так зовет себя девушка на манер героини из произведения Франсуазы Саган «Волшебные облака» — прикована к инвалидному креслу, и многое из жизни обычных людей ей недоступно. Благодаря дружбе с Жозе, Цунэо, не особо заботящийся о своей жизни, начинает осознавать ценность того, что имеет. В то время как девушка, не без участия парня, решает, что наконец пришло время встретиться лицом к лицу с реальным миром. Так они, сами того не замечая, помогают друг другу кто как умеет, и в конце концов их дружба начинает обретать иные оттенки, омрачить которые не в силах даже косые взгляды окружающих.', , 1, 1);

